export interface Headers {
    [key: string]: string | undefined;
}
export interface QueryStringParameters {
    [key: string]: string | undefined;
}
export interface Body {
    [key: string]: unknown;
}
export interface RequestData {
    body: Body | null;
    headers: Headers;
    httpMethod: string;
    path: string;
    queryStringParameters: QueryStringParameters | null;
}
